import React from 'react';

import './nav.scss';

function Nav() {
	function recipe(e) {
		e.preventDefault();
		alert('Recipe');
	}

	return (
		<div className="nav">
			<i onClick={recipe} className="fas fa-utensils fa-2x"></i>
			<i className="fas fa-calculator fa-2x"></i>
			<i className="fas fa-list fa-2x"></i>
			<i className="fas fa-shopping-cart fa-2x"></i>
			<i className="fas fa-home fa-4x"></i>
		</div>
	);
}

export default Nav;
